import { Row, Container, Col } from "reactstrap";
import { theme } from "../../config";

const Item = () => {
  return (
    <div>
      <img
        src={"/yensaodatquang/assets/img/xay-dung-nha-yen.JPG"}
        style={{ width: "100%", borderRadius: theme.spacing(3) }}
      />
    </div>
  );
};
export const Feature = () => {
  return (
    <section
      style={{ marginTop: theme.spacing(7), marginBottom: theme.spacing(7) }}
    >
      <Container>
        <Row>
          <Col xs={12} md={4}>
            <Item />
          </Col>
        </Row>
      </Container>
    </section>
  );
};
